import styled from "styled-components";

const TeamSectionWrapper = styled.div`
  padding: 85px 0;
  background:#f9faff;

  .alice-carousel__stage-item {
    padding: 1rem !important;
    margin:20px;
    width:265px;
  }

  .team-item-wrapper {
    background: #000;
    padding: 1rem;
  }
  @media only screen and (max-width: 320px) {
    .wallet-left-content {
      .heading {
        font-size: 25px;
        line-height: 35px;
      }
    }
  }
`;

export default TeamSectionWrapper;
